import React from "react";

const Projects = (props) => {
	console.log(props);
	return (
		<div>
			<div>
				<h1>helllo</h1>
				<p>yes we r here proceed</p>
			</div>
			<div>
				{props.websites.websites.map((site) => {
					return (
						<div key={site.id} className={site.className}>
							<div>
								<img src={site.image} alt="" />
							</div>
							<div>
								<h3>{site.name}</h3>
								<p>{site.description}</p>
								<p>{site.Responsibilities}</p>
								<p>{site.languagesDisplayed[0]}</p>
							</div>
						</div>
					);
				})}
			</div>
		</div>
	);
};

export default Projects;
